                desc: "바다에 어울리는 서핑과 음악을 컨셉으로 매년 열리는 강원도 고성 지역 페스티벌. 파도와 서핑 그리고 토끼가 나오는 심블과 기울기를 가진 레터 타입으로 생동감을 주어 디자인하였으며 그래픽 모티브는 물결의 곡선을 그래픽 화 시켜서 물을 형상화했다. 다양한 이벤트들을 응용하여 FI를 다채롭게 만들었다.",
